import { Page, Locator } from '@playwright/test';
import HelperClass from "../util/methods.utility.ts";
import locators from "../locators/Sign in to your account.locators.ts";

class SignintoyouraccountPage {
  page: Page;
  helper: HelperClass;
  enterYourEmailPhoneOrSkype: Locator;
  submit: Locator;
  enterThePasswordFor2218532CognizantCom: Locator;

  constructor(page: Page) {
    this.page = page;
    this.helper = new HelperClass(page);
    this.enterYourEmailPhoneOrSkype = page.locator(locators.enterYourEmailPhoneOrSkype);
    this.submit = page.locator(locators.submit);
    this.enterThePasswordFor2218532CognizantCom = page.locator(locators.enterThePasswordFor2218532CognizantCom);
  }

  private coerceValue(value: unknown): string {
    if (value === undefined || value === null) {
      return '';
    }
    if (typeof value === 'number') {
      return `${value}`;
    }
    if (typeof value === 'string') {
      return value;
    }
    return `${value ?? ''}`;
  }

  private normaliseDataKey(value: string): string {
    return (value || '').replace(/[^a-z0-9]+/gi, '').toLowerCase();
  }

  private resolveDataValue(formData: Record<string, any> | null | undefined, key: string, fallback: string = ''): string {
    const target = this.normaliseDataKey(key);
    if (formData) {
      for (const entryKey of Object.keys(formData)) {
        if (this.normaliseDataKey(entryKey) === target) {
          const candidate = this.coerceValue(formData[entryKey]);
          if (candidate.trim() !== '') {
            return candidate;
          }
        }
      }
    }
    return this.coerceValue(fallback);
  }

  async setYourEmail(value: unknown): Promise<void> {
    const finalValue = this.coerceValue(value);
    await this.enterYourEmailPhoneOrSkype.fill(finalValue);
  }

  async setThePasswordFor2218532(value: unknown): Promise<void> {
    const finalValue = this.coerceValue(value);
    await this.enterThePasswordFor2218532CognizantCom.fill(finalValue);
  }

  async applyData(formData: Record<string, any> | null | undefined, keys?: string[], index: number = 0): Promise<void> {
    const fallbackValues: Record<string, string> = {
      "your email": "",
      "the password for 2218532": "",
    };
    const targetKeys = Array.isArray(keys) && keys.length ? keys.map((key) => this.normaliseDataKey(key)) : null;
    const shouldHandle = (key: string) => {
      if (!targetKeys) {
        return true;
      }
      return targetKeys.includes(this.normaliseDataKey(key));
    };
    if (shouldHandle("your email")) {
      await this.setYourEmail(this.resolveDataValue(formData, "your email", fallbackValues["your email"] ?? ''));
    }
    if (shouldHandle("the password for 2218532")) {
      await this.setThePasswordFor2218532(this.resolveDataValue(formData, "the password for 2218532", fallbackValues["the password for 2218532"] ?? ''));
    }
  }
}

export default SignintoyouraccountPage;

